import React from 'react';

import bgIcon from '../../assets/images/success-background.svg';
import './styles.css';

function Success(){
    return(
        <div id="sucess-register">
            <div id="sucess-content" className="container">
                <img src={bgIcon} alt="Sucesso"/>
                <h1>Cadastro concluído</h1>
            </div>
        </div>
    )
}

export default Success;
